contracts/Startup.sol.content:
// SPDX-License-Identifier: SimPL-2.0
pragma solidity >=0.8.x <0.9.0;

import "../contracts/base/Base.sol";

contract Startup is Base
{
    enum Mode{
        NONE, ESG, NGO, DAO, COM
    }

    struct wallet {
        string name;
        address walletAddress;
    }

    struct Profile {
        /** startup name */
        string name;
        /** startup type */
        Mode mode;
        /** startup hash */
        string[] hashtag;
        /** startup logo src */
        string logo;
        /** startup mission */
        string mission;
        /** startup token contract */
        address tokenContract;
        /** startup compose wallet */
        // wallet[] wallets;
        string overview;
        /** is validate the startup name is only */
        // bool isValidate;
    }

    event created(string name, Profile startUp);

    //public 属性自动生成同名get方法
    mapping(string => Profile) public startups;

    constructor() Base()
    {
        _owner = msg.sender;
    }

    function newStartup(Profile memory p) public payable {
        require(_coinbase != address(0), "the address can not be the smart contract address");
        require(bytes(p.name).length != 0, "name can not be null");
        //名称唯一
        // require(!startups[p.name].isValidate,"startup name has been used");
        // p.isValidate = true;
        startups[p.name] = p;
        emit created(p.name,p);
    }
}

contracts/base/Base.sol.content:
// SPDX-License-Identifier: SimPL-2.0
pragma solidity >=0.8.x <0.9.0;

contract Base
{
    address internal  _owner;
    address payable internal  _coinbase;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier isOwner() {
        assert(msg.sender == _owner);
        _;
    }

    constructor()
    {
        _owner = msg.sender;
    }

    fallback() external virtual payable {
        revert();
    }

    receive() external payable {
        revert();
    }

    function setCoinBase(address payable cb) internal isOwner {
        _coinbase = cb;
    }

    function transferOwnership(address newOwner) public virtual isOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }

    function suicide0(address payable receiver)
    public
    isOwner {
        selfdestruct(receiver);
    }
}

